subSubSection.paragraph:
Fins:
Rhomboid, posteriorly connected to mantle, slightly ovate and moderately long, comprising ~ 59% ML (
Table 4
; 
Fig. 2A
).

Tentacle:
Club long and broad, ~ 37% ML (
Table 4
). Carpus, manus and dactylus uniformly distributed, with boundaries not very sharp, hindering their definition (especially between manus and dactylus); 4 diagonal rows of suckers along club as stated for 

D. pleii
;

2 central rows at manus not so different in size from other suckers (
Fig. 2B
). Each sucker with small ring of teeth apparently at surface of sucker’s aperture. Longitudinal muscle around suckers present (
Fig. 2D
).
